import { useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const Form = () => {
  //formulario y estado deben de tener los mismos valores

  const [form, setForm] = useState({
    name: "",
    min_height: "",
    max_height: "",
    min_weight: "",
    max_weight: "",
    life_span: "",
    temperament: "",
    image: "",
  });

  const [errors, setErrors] = useState({
    name: "",
    min_height: "",
    max_height: "",
    min_weight: "",
    max_weight: "",
    weight: "",
    life_span: "",
    temperament: "",
    image: "",
  });
  const changeHandler = (e) => {
    //e, me dice quien disparo el event
    const property = e.target.name;
    const value = e.target.value;

    validate({ ...form, [property]: value }); //el mismo estado tiene validate y va a la par
    setForm({ ...form, [property]: value }); //cambio el estado y cambia el input
  };
  const validate = (form) => {
    const errors = {};

    // validate name field
    if (/^[A-Za-z]+$/.test(form.name)) {
      errors.name = "";
    } else {
      errors.name = "Name error";
    }
    if (form.name === "") {
      errors.name = "This field can not be blank";
    }

    // validar min_height 
    if (!/^\d+$/.test(form.min_height)) {
      errors.min_height = "Please enter a valid height";
    }
    // validar max_height 
    if (!/^\d+$/.test(form.max_height)) {
      errors.max_height = "Please enter a valid height";
    }

    // validar min_weight 
    if (!/^\d+$/.test(form.min_weight)) {
      errors.min_weight = "Please enter a valid weight";
    }
    // validate max_weight field
    if (!/^\d+$/.test(form.max_weight)) {
      errors.max_weight = "Please enter a valid weight";
    }

    // validate life_span field
    if (!/^\d+$/.test(form.life_span)) {
      errors.life_span = "Please enter a valid life span";
    }
    setErrors(errors);
  };

  const submitHandler = (e) => {
    const height = `${form.min_height}-${form.max_height}`; //creo las variables y las concateno separandolas con un guion
    const weight = `${form.min_weight}-${form.max_weight}`;
    e.preventDefault(); ///ya no se va la pag ref
    axios
      .post("http://localhost:3001/dogs", { ...form, height, weight }) //envio el body form  junto con las variables (weight y hei)
      .then((res) => alert(res))
      .catch((err) => alert(err));
  };

  return (
    <div>
    <form onSubmit={submitHandler}>
      <div>
        <label>Name:</label>
        <input
          type="text "
          value={form.name}
          onChange={changeHandler}
          name="name"
        />
        {errors.name && <span>{errors.name}</span>}
      </div>

      <div>
        <label>Min Height:</label>
        <input
          type="text"
          value={form.min_height}
          onChange={changeHandler}
          name="min_height"

          className="number"
              placeholder="Height-Min"

        />
        {errors.min_height && <span>{errors.min_height}</span>}
      </div>

      <div>
        <label>Max Height:</label>
        <input
          type="text"
          value={form.max_height}
          onChange={changeHandler}
          name="max_height"
        />
        {errors.max_height && <span>{errors.max_height}</span>}
      </div>
      <div></div>
      <div>
        <label>Min Weight:</label>
        <input
          type="text"
          value={form.min_weight}
          onChange={changeHandler}
          name="min_weight"
        />
         {errors.min_weight && <span>{errors.min_weight}</span>}
      </div>
      <div>
        <label>Max Weight:</label>
        <input
          type="text"
          value={form.max_weight}
          onChange={changeHandler}
          name="max_weight"
        />
        {errors.max_weight && <span>{errors.max_weight}</span>}
      </div>
      <div>
        <label>Life Span:</label>
        <input
          type="text "
          value={form.life_span}
          onChange={changeHandler}
          name="life_span"
        />
        {errors.life_span && <span>{errors.life_span}</span>}
      </div>
      <div>
        <label>Chose a Temperament:</label>
        <input
          type="text "
          value={form.temperament}
          onChange={changeHandler}
          name="temperament"
        />
      </div>
      <div>
        <label>image:</label>
        <input
          type="text "
          value={form.image}
          onChange={changeHandler}
          name="image"
        />
      </div>
      <button type="submit">Lets Create</button>
    </form>
    <Link to="/home">R</Link>
    </div>
  );
};

export default Form;
